import './App.css';
import styled from 'styled-components'

const Button = styled.button`
color : black;
font-size : 30px;
background-color : red;
`;

const Pdd = styled.p`
font-size : 30px;
color : green;
font-weight : 800

`;

function App() {
  return (
    <div className="App">
      <Button>salam</Button>
      <Pdd>selokim</Pdd>

    </div>
  );
}

export default App;
